import styled from "styled-components";

export const Gallery_Container = styled.div`
  width: 100%;
  max-width: 1100px;
  margin: auto;
  position: relative;
  height: 1000px;
`;


export const Gallery_Wrapper = styled.div`
  display: flex;
  position: absolute;
`;
